import React from "react";
import { connect } from "react-redux";

const names = ["James", "Paul", "John", "George", "Ringo"];

const mapStateToProps = (state) => {
  return {
    getLoggingList: state.inventorys.getLoggingList,
    errorLoggingList: state.inventorys.errorLoggingList,
    HitungLogging: state.inventorys.getLoggingList.length, //HITUNG JUMLAH DATA LOGGING
  };
};

const createTable = (props) => {
  let table = [];

  for (let j = 0; props.HitungLogging < 5; j++) {
    table.push(<div>{`Column ${j + 1}`}</div>);
  }
  return table;
};

const File1 = (props) => {
  return (
    <div>
      <div>
        {createTable()}
      </div>
      {names.map((name) => (
        <li>{name}</li>
      ))}
    </div>
  );
};

export default connect(mapStateToProps, null)(File1);
